    "generalized-peak-skew-coefficients-for-oklahoma-1961-1990-base-period",nt"isopen":
    false,nt"url": null,nt"notes": "This digital-map data set consists of a
    grid of generalized skew coefficients of logarithms of annual maximum streamflow
    for Oklahoma streams less than or equal to 2,510 square miles in drainage area.
    This grid of skew coefficients is taken from figure 11 of the Tortorelli and Bergman,
    1985 report, "Techniques for estimating flood peak discharges for unregulated streams
    and streams regulated by small floodwater retarding structures in Oklahoma," U.S.
    Geological Survey Water-Resources Investigations Report 84-4358. The skew coefficients
    were used to develop peak-flow regression equations in the Tortorelli, 1997 report,
    "Techniques for estimating peak-streamflow frequency for unregulated streams and
    streams regulated by small floodwater retarding structures in Oklahoma," U.S. Geological
    Survey Water-Resources Investigations Report 97-4202. Only skew coefficient values
    within Oklahoma are intended for use with the regression equations. To save disk
    space, the skew coefficient values have been multiplied by 100 and rounded to integers
    with two significant digits.",nt"license_title": null,nt"extras": [{ntt"key":
